import {Button, Grid, ToggleButton, ToggleButtonGroup, Typography} from "@mui/material";
import React from "react";

type AuthRequiredPropsType = {
    authFor: 'Bonus' | 'VAccini',
    authFunction: ()=>void
}
const AuthRequired = (props: AuthRequiredPropsType) => {
    const authFor= props.authFor
    const authFunction= props.authFunction
    return (
        <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
            <Typography variant="h4" sx={{marginBottom: 2}}>Per visualizzare i tuoi {authFor} devi fornire la tua autorizzazione</Typography>
            <Button variant="contained" onClick={authFunction}>Autorizza</Button>
        </Grid>
    );
}

export default AuthRequired;
